 \end{pmatrix}
 \in M_{p,1}(K)\]on a :&nbsp; <br>&nbsp;&nbsp; \[ AX = x_1 C_1 + x_2 C_2 + \cdots + x_p C_p.\]<br>2. De même, si \( E_i \) est la matrice de \( M_{1,n}(K) \) dont seul le coefficient de la \( i \)-ème colonne est non nul et vaut \( 1 \), alors \( E_i A = L_i \), la \( i \)-ème ligne de \( A \).&nbsp;&nbsp;

