On note \( K[X] \) la partie de \( K^{\mathbb{N}} \) formée des suites nulles à partir d'un certain rang.&nbsp; <br><br>Les éléments de \( K[X] \) sont appelés polynômes à coefficients dans \( K \).&nbsp;<br>Pour \( k \in \mathbb{N} \), on note \( X^k \) l'élément \( (u_n)_{n \in \mathbb{N}} \) de \( K[X] \) défini par&nbsp; <br><br>\[u_n =
\begin{cases}
1, &amp; \text{si } n = k \\
0, &amp; \text{sinon}
\end{cases}
= (0, 1, 0, 0, \dots).\]

Soient \( P, Q \in K[X] \), soit \( \lambda \in K \) et soit \( n \in \mathbb{N} \).&nbsp; <br><br>1. \(\deg P^{(n)} =  
   \begin{cases}  
   \deg(P) - n, &amp; \text{si } \deg(P) \geqslant n \\  
   -\infty, &amp; \text{sinon}  
   \end{cases}\)&nbsp; <br><br>2. \( (\lambda P + Q)^{(n)} = \lambda P^{(n)} + Q^{(n)} \).&nbsp;&nbsp;

Soient \(a\) et \(b\) deux réels. On a :<br>\[\bullet i) \quad a \leq |a|\]\[\bullet ii) \quad |a|^2 = a^2 \quad \text{et donc} \quad |a| = \sqrt{a^2}\]\[\bullet iii) \quad |ab| = |a| \cdot |b|\]\[\bullet iv) \quad \text{Si } b \neq 0, \text{ alors } \left|\frac{a}{b}\right| = \frac{|a|}{|b|}\]\[\bullet v) \quad |a| = |b| \iff (a = b \text{ ou } a = -b)\]\[\bullet vi) \quad \text{Si } b \geq 0, \text{ alors } 
\begin{cases} 
|a| \leq b \iff -b \leq a \leq b \\
|a| \geq b \iff (a \geq b \text{ ou } a \leq -b)
\end{cases}\]<br><br>Ces inégalités restent valables si l’on remplace les inégalités larges (\(\leqslant\)) par des inégalités strictes (\(&lt;\)).

Soit \( f \) une fonction définie sur un intervalle de la forme \( ]a, b] \), \( ]a, b[ \), ou \( ]a, +\infty[ \).<br>On dit que&nbsp;\( f \) est prolongeable par continuité en \( a \) si \( f \) admet une limite finie en \( a \).<br>Le prolongement par continuité de \( f \) en \( a \) est la fonction \( \widetilde f \space\) définie sur \( [a, b] \), \( [a, b[ \), ou \( [a, +\infty[ \) par :&nbsp; <br>\[\widetilde f(x) := 
\begin{cases} 
\lim_{t \to a^+} f(t) &amp; \text{si } x = a, \\
f(x) &amp; \text{sinon.}
\end{cases}\]<br>La fonction ainsi prolongée est nécessairement continue en \( a \).

